import Circles from './assets/Circles.svg';
import './App.css';
import Typical from 'react-typical';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Circles} className="App-logo" alt="logo" />
        <Typical
        steps={['Hello', 1000, 'Hello world!', 500]}
        loop={Infinity}
        wrapper="p"
      />
      </header>
    </div>
  );
}

export default App;
